INSERT INTO meals (id, user_id, date_time, description, calories, type1, type2, cod, naimenovanie, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture) VALUES (302032, 100000, '2017-10-12 09:22:30.078000', '', 0, 'Пожарно-охранное оборудование', '', 6176, 'Видеокамера AVC 201 f=206', '', 'шт', 4, 2500, 'ричи Накладная уличная камера Activision AVC-201 со встроенным объективом и герметичным корпусом идеально подходит для установки как внутри помещения, так и снаружи.  Рекомендована для наружной установки, специальная технология герметизации корпуса обеспечивает гарантированную работу камеры при любой влажности (до 1м под водой - кратковременно). Применяется как в  сложных системах видеонаблюдения, так и в комплекте с обычным  телевизором (для чего имеет вход Video IN). Встроенная ИК-подсветка поможет разглядеть объект в условиях плохой видимости (в стандартной комплектации - до 5 м, под заказ - до 10м). Сферообразное исполнение видеокамеры AVC-201 позволяет направлять объектив практически в любую сторону. не меняя положение врезной части корпуса самой камеры. Козырёк защищает от прямого попадания влаги на стекло объёктива видеокамеры и от прямых солнечных лучей.', 'AVC 201', '06176osnova');
INSERT INTO meals (id, user_id, date_time, description, calories, type1, type2, cod, naimenovanie, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture) VALUES (302033, 100000, '2017-10-12 09:59:32.793000', '', 0, 'Пожарно-охранное оборудование', '', 6860, 'AVIR-613-3 ИК подсветка цилиндрический корпус дальность 25м угол 30 град ', '', 'шт', 1, 2500, 'ричи Предназначена для камер видеонаблюдения.  Цилиндрический корпус, дальность 25 м, угол 30 град., длина волны 880 нМ, напряжение питания 12 В, ток потребления 160 мА.', 'AVIR-613-3', '06860osnova');
