INSERT INTO meals (id, user_id, date_time, description, calories, type1, type2, cod, naimenovanie, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture) VALUES (300814, 100000, '2017-11-21 10:39:50.655000', '', 0, 'Офисное оборудование', '', 29593, 'Картридж для Samsung ML , SCX , SF-650', '', 'шт', 6, 3000, 'Картридж лазерный Samsung MLT-D105S стандартной емкости – это оригинальное расходное устройство, которое предназначено для принтеров Samsung серий ML, SCX и SF. Данная модель картриджа имеет очень высокий производительный потенциал. При помощи Samsung MLT-D105S пользователь может создавать отпечатки на профессиональном уровне.  Главной особенностью картриджа является компактность, легкость управления и установки. Использование такого картриджа гарантирует надежную работу печатного оборудования. Эта модель понравится любителям печатать дома и профессионалам небольшого бизнеса. Печатного ресурса хватает на 1.5 тысячи напечатанных страниц. Для удобства устройство оснащено специальной технологией контроля и информирования о количестве тонера.', 'MLT-D105S', '29593osnova');
