INSERT INTO meals (id, user_id, date_time, description, calories, type1, type2, cod, naimenovanie, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture) VALUES (302129, 100000, '2017-10-15 12:46:12.226000', '', 0, 'Сетевое оборудование', '', 7965, 'Переключатель D-LINK ', '', 'шт', 2, 10000, 'ричи 16-портовый стекируемый переключатель KVM DKVM-16 - это экономически эффективное решение для бизнеса. Разработанный для управления множеством серверов через одну клавиатуру, мышь и монитор, данный переключатель позволяет объединить в стек до 8 подобных устройств для получения 128 портов KVM. Переключатель DKVM-16 допускает установку в стандартную 19'''' стойку, размещаемую в центральной серверной комнате.', 'DKVM-16', '07965osnova');
