INSERT INTO meals (id, user_id, date_time, description, calories, type1, type2, cod, naimenovanie, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture) VALUES (301314, 100000, '2017-11-26 14:55:17.895000', '', 0, 'Сетевое оборудование', '', 50875, 'Источник бесперебойного питания APC smart-ups 1500va/980w', '', 'шт', 1, 39000, 'ИБП APC Smart-UPS 1500VA LCD [SMT1500I] может выдавать выходную мощность до 1500 Вт и питать энергией до восьми устройств-потребителей одновременно. Он выпрямляет ток, порой идущий из сети с большими перепадами, и защищает приборы от воздействия колебаний напряжения и частоты тока. Когда пропадает энергия в сети, ИБП может в течение 6.7 минут питать все подключенные приборы энергией своего аккумулятора, которому требуется для накопления полного заряда всего 3 часа', 'SMT1500I', '50875osnova');
